import React from 'react';
import styled from 'styled-components';
import { H6, H1, H2, H5,  H4 } from 'components/Typography';
import Container from 'components/Container';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { StyledRow, StyledCol  } from 'components/FlexBox';

const Content = styled.div`
    color: ${props => props.theme.colors.white};
    background-color: ${props => props.theme.colors.primary};
    width: 100%;
    height: 400px;
    font-family: 'Raleway', sans-serif;

    @media (max-width: ${props => props.theme.screenSize.tablet}) {
       height: 600px;

    }
`;

const TextContainer = styled.div`
    padding: 10px;
    text-align: center;
    padding-bottom: 40px;
    @media (max-width: ${props => props.theme.screenSize.tablet}) {
        text-align: center;
        transform: translate(0%, 0%);
        height: 100%;
        padding: 10px;
    }
`;

const CardText = styled.div`
    padding: 10px;
    @media (max-width: ${props => props.theme.screenSize.tablet}) {
        text-align: center;
        transform: translate(0%, 0%);
        height: 100%;
        padding: 10px;
    }
`;

const Logo = styled(H6) `
    text-align: center;
    `;

const SiteBottom = styled.div`
    min-width: 100%;
    height: 40px;
    margin-top: calc(100% - 40px)
    z-index: 1000;
    position: absolute;
    background-color: ${props => props.theme.colors.darkPrimary}
`;

const ProfileImage = styled.img`
    max-height: 150px;
    border-radius: 100px;
    text-align: right;
    align-self: flex-end;
    margin-left: auto

`

const Section = () =>
    <div>
        <Content>
            <Container>
                <TextContainer>
                    <H2 light bold>Ota yhteyttä niin suunnitellaan yhdessä verkkosivuprojektisi!</H2>
                </TextContainer>

                <StyledRow >

                    <StyledCol   mdOffset={3} xs={6} sm={6} md={6} lg={6}>
                        <ProfileImage src='https://scontent-arn2-1.xx.fbcdn.net/v/t1.0-9/10356345_625753394174801_4909397701096970187_n.jpg?_nc_cat=108&_nc_ht=scontent-arn2-1.xx&oh=dc72b780cd62254184337f5be1d38c98&oe=5D712D4A' />
                    </StyledCol>
                    <StyledCol xs={6} sm={6} md={6} lg={6}>
                    <CardText >
                        <H5 bold light>	<FontAwesomeIcon icon="envelope" /> info@webin.fi</H5>
                        <H5 bold light><FontAwesomeIcon icon="phone" /> +358442360403</H5>
                    </CardText>
                    </StyledCol>
                </StyledRow>

            </Container>
        </Content>
    </div>;

export default Section;
